import React, { Fragment } from "react";  
import ListItems from "./ListItems";

function App () {

  const listItems = [];

  return (
    <Fragment>
      <form name="itemForm">
        <input type="text"/>
        <input type="submit" onClick="addItem()"/>
      </form>
      <ListItems list={listItems}/>
    </Fragment>
  );

}

export default App;
